import React from 'react';
import './styles.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <section className="arrows">
            <span className="arrow-1"></span>
            <span className="arrow-2"></span>
            <span className="arrow-3"></span>
        </section>
        <button>New Decision</button> 
      </header>
    </div>
  );
}

export default App;
